import React, { useEffect } from 'react';
import '../src/Contact.css';
import Typed from 'typed.js';

function Contact() {
    const el = React.useRef(null);

    useEffect(() => {
        const typed = new Typed(el.current, {
            strings: ["Software Engineer", "Web Developer", "Full Stack Developer", "Backend Developer", "Frontend Developer", "Mobile App Developer", "UI/UX Developer", "Game Developer", "Database Developer"],
            typeSpeed: 30,
            backSpeed: 10,
            backDelay: 2000,
            cursorChar: ' __',
            shuffle: true,
            loop: true,
            smartBackspace: false,
        });
        return () => {
            typed.destroy();
        }
    }, []);


    return (
        <>
            <div className='contactSection d-flex flex-column align-items-center justify-content-center'>
                <p className="fs-1" >Get in touch</p>
                <p className='fs-5' style={{ opacity: "60%" }}>Feel free to contact me or just come say Hi! </p>
                <p className='fs-6' style={{ opacity: "60%" }}>I'm open to positions such as:</p>
                <div>
                    <span ref={el} className='fs-3' style={{ fontFamily: "Anonymous Pro" }} />
                </div>


            </div>

            <div className='d-flex justify-content-center text'>
                <p style={{ opacity: "50%", fontSize: "13px" }} className='d-flex flex-column align-self-center justify-content-center'>
                    Designed & Built by Howard Tung
                </p>
            </div>
        </>
    );
}

export default Contact;
